import React from 'react';
import {
  Typography,
  Table,
  TableBody,
  TableCell,
  TableHead,
  TableRow,
  Box,
  Paper
} from '@mui/material';

const FormComponentInternship = ({ marksData, rollNumber, name }) => {
  return (
    <Box sx={{ p: 2 }}>
      {/* Roll Number & Name outside the Box */}
      <Typography variant="h6" gutterBottom>
        <strong>Roll Number:</strong> {rollNumber}
      </Typography>
      <Typography variant="h6" gutterBottom>
        <strong>Name:</strong> {name}
      </Typography>

      {/* Table inside styled Box */}
      <Box
        sx={{
          mt: 3,
          borderRadius: 2,
          p: 2,
          background: 'color: #BFBDC1',
          color: '#fff',
          boxShadow: '0 2px 6px rgba(0,0,0,0.1)',
        }}
      >
        <Typography variant="h5" gutterBottom sx={{ fontWeight: 'bold' }}>
          Subject-wise Marks
        </Typography>
        <Table component={Paper} sx={{ backgroundColor: 'transparent' }}>
          <TableHead>
            <TableRow>
              <TableCell sx={{ fontWeight: 'bold', color: '#fff' }}>Semester</TableCell>
              <TableCell sx={{ fontWeight: 'bold', color: '#fff' }}>Subject</TableCell>
              <TableCell sx={{ fontWeight: 'bold', color: '#fff' }}>Max Marks</TableCell>
              <TableCell sx={{ fontWeight: 'bold', color: '#fff' }}>Passing Marks</TableCell>
              <TableCell sx={{ fontWeight: 'bold', color: '#fff' }}>Marks Awarded</TableCell>
              <TableCell sx={{ fontWeight: 'bold', color: '#fff' }}>Attempts</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {marksData.map((row, index) => (
              <TableRow key={index}>
                <TableCell sx={{ color: '#fff' }}>{row.semester}</TableCell>
                <TableCell sx={{ color: '#fff' }}>{row.subject}</TableCell>
                <TableCell sx={{ color: '#fff' }}>{row.maxMarks}</TableCell>
                <TableCell sx={{ color: '#fff' }}>{row.passingMarks}</TableCell>
                <TableCell sx={{ color: '#fff' }}>{row.marksAwarded}</TableCell>
                <TableCell sx={{ color: '#fff' }}>{row.attempts}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </Box>
    </Box>
  );
};

export default FormComponentInternship;
